# 2D windowed sinc interpolation function
def sinc_interp_2d(signal, x_grid, y_grid, x_interp, y_interp, window_size=8):
    """
    Interpolates 2D signal at points (x_interp, y_interp) using a windowed sinc function.
    signal: 2D signal array
    x_grid, y_grid: original sample points in pixels
    x_interp, y_interp: interpolation points in pixels
    window_size: size of the sinc window (in pixels)
    """
    interpolated = np.zeros(len(x_interp))
    for i in range(len(x_interp)):
        val = 0.0
        for j in range(signal.shape[0]):  # Rows (y)
            for k in range(signal.shape[1]):  # Columns (x)
                dx = x_interp[i] - k
                dy = y_interp[i] - j
                if abs(dx) <= window_size and abs(dy) <= window_size:
                    # Blackman window in 2D
                    window_x = 0.42 + 0.5 * np.cos(np.pi * dx / window_size) + 0.08 * np.cos(2 * np.pi * dx / window_size)
                    window_y = 0.42 + 0.5 * np.cos(np.pi * dy / window_size) + 0.08 * np.cos(2 * np.pi * dy / window_size)
                    sinc_x = np.sinc(dx)
                    sinc_y = np.sinc(dy)
                    val += signal[j, k] * sinc_x * sinc_y * window_x * window_y
        interpolated[i] = val
    return interpolated

# Original sample points in pixel coordinates
